//this is just standard CRC32, didn't use java.util.zip.CRC32 since that doesn't allow to set the initial value of the LFBSR
static uint32 Crc32(uint32 iv, int data[], int offset, int length)
{
  for (int i = offset; i < offset + length; ++i) {
    for (int j = 0; j < 4; ++j) {
      uint32 temp = (uint32)((iv ^ (data[i] >> (8 * j))) & 0xFF);

      for (int k = 0; k < 8; ++k) {
        if ((temp & 1) == 1) {
          temp >>= 1;
          temp ^= 0xEDB88320;
        }
        else {
          temp >>= 1;
        }
      }

      iv >>= 8;
      iv ^= temp;
    }
  }
  return iv;
}

static uint32 Crc32(uint32 iv, u8 data[], int offset, int length)
{
  for (int i = offset; i < offset + length; ++i) {
    uint32 temp = (iv ^ data[i]) & 0xFF;

    for (int j = 0; j < 8; ++j) {
      if ((temp & 1) == 1) {
        temp >>= 1;
        temp ^= 0xEDB88320;
      }
      else {
        temp >>= 1;
      }
    }

    iv >>= 8;
    iv ^= temp;
  }
  return iv;
}

static void SetChecksum(byte* save, byte* checksum, int regionOffset, int regionLength)
{
  memcpy(save + regionOffset + regionLength, checksum, 0x200);
}

static bool CheckChecksum(byte* save, byte* checksum, int regionOffset, int regionLength)
{
  return memcmp(save + regionOffset, checksum, regionLength);
}

static byte* GenerateSlotChecksum(byte* save, int offset, int length, int saveSlot)
{
  u8* checksum = (u8*)malloc(0x200);
  if (!checksum) return nullptr;
  uint32 constants[] = { 0x55012174, 0x9FA3690, 0x4F5AE762, 0xA37A55D7 };
  int slotConstantsGenerator[] = { 0x2EA10CEB, 0x204DE35E, 0x4BF0CF23, 0x72B401FD, 0x5CDD1F19, 0x681BA6CF, 0x626B4CA, 0x7C8B3AF0 };
  int lengthInt = length >> 3;

  int hashLookup[8] = {};
  int partialCrcs[8] = {};
  int crcLengths[8] = {};
  int slotConstants[8] = {};

  for (int i = 0; i < 8; ++i)
  {
    slotConstants[i] = (int)(slotConstantsGenerator[i] ^ constants[-saveSlot - i - 1 & 3]);
  }

  for (int i = 0; i < 7; ++i)
  {
    float variation = FLOAT_CONSTANTS[(slotConstants[i] + INTEGER_CONSTANTS[slotConstants[i] & 0xfff]) & 0xfff];
    crcLengths[i] = (int)((variation - 0.5F) * (float)lengthInt) + (i + 1) * lengthInt;
  }
  crcLengths[7] = length;

  int crcInit = slotConstants[0];
  int currentLength = crcLengths[0];
  for (int i = 0; i < 8; ++i)
  {
    partialCrcs[i] = (int)Crc32((uint32)crcInit, save, offset, currentLength);
    if (i < 7)
    {
      offset += currentLength;
      currentLength = crcLengths[i + 1] - crcLengths[i];
      crcInit = partialCrcs[i] ^ slotConstants[i + 1];
    }
  }

  for (int i = 0; i < 7; ++i)
  {
    hashLookup[i] = slotConstants[i] ^ partialCrcs[i] ^ partialCrcs[7];
  }
  hashLookup[7] = slotConstants[7] ^ partialCrcs[7];

  int nextIndex = (int)Crc32(Crc32(0xA37A55D7 ^ constants[3 - saveSlot], slotConstants, 0, 8), partialCrcs, 0, 8);
  int currentIndex;
  int jump = (int)((uint32)nextIndex >> 24) + (nextIndex >> 16 & 0xFF) + (nextIndex >> 8 & 0xFF) + (nextIndex & 0xFF);
  for (int i = 0; i < 0x200; i += 4)
  {
    currentIndex = nextIndex & 0xFFF;
    nextIndex = (nextIndex + jump + 1) & 0xFFF;
    int checksumInt = (int)(INTEGER_CONSTANTS[currentIndex] ^ hashLookup[(INTEGER_CONSTANTS[currentIndex] + saveSlot) & 7]);
    if ((INTEGER_CONSTANTS[currentIndex] & 0x7) == 1)
      checksumInt ^= 0xBD75F29; // = crc32(0x1079000F, "ONSTER HUNTER WORLD: ICEBORNE".getBytes(StandardCharsets.UTF_8), 0, 0x1D)
    checksum[i] = (byte)checksumInt;
    checksum[i + 1] = (byte)(checksumInt >> 0x8);
    checksum[i + 2] = (byte)(checksumInt >> 0x10);
    checksum[i + 3] = (byte)(checksumInt >> 0x18);
  }

  return checksum;
}

static void GenerateKeys(byte keys[0x20][0x10], uint32 keySalt, u8 salt[])
{
  uint32 c1 = 0x5A8B79A9 ^ keySalt; //0x5A8B79A9 = 0x84AFC3C8(INTEGER_CONSTANTS[0x5D7]) ^ 0xA37A55D7 ^ 0x7D5EEFB6
  uint32 c2 = 0x34616F90 ^ keySalt; //0x5A8B79A9 = 0xEB9000B7(INTEGER_CONSTANTS[0x821]) ^ 0xA37A55D7 ^ 0x7C8B3AF0
  uint32 c3 = 0xC4C638DF ^ keySalt; //0x5A8B79A9 = 0x3A226A4A(INTEGER_CONSTANTS[0xA6B]) ^ 0xA37A55D7 ^ 0x5D9E0742
  uint32 c4 = 0x94FB64E8 ^ keySalt; //0x5A8B79A9 = 0x479C6C57(INTEGER_CONSTANTS[0xCB5]) ^ 0xA37A55D7 ^ 0x701D5D68

  for (int i = 0; i < 32; ++i)
  {
    //uint encodedKeyIndex = ReadInt(salt, i << 2);
    uint32 encodedKeyIndex = (uint32)((salt[(i << 2)] & 0xFF) | ((salt[(i << 2) + 1] & 0xFF) << 8) | ((salt[(i << 2) + 2] & 0xFF) << 16) | ((salt[(i << 2) + 3] & 0xFF) << 24));
    uint32 k = encodedKeyIndex ^ c1;
    keys[i][0] = (byte)(k);
    keys[i][1] = (byte)(k >> 0x8);
    keys[i][2] = (byte)(k >> 0x10);
    keys[i][3] = (byte)(k >> 0x18);

    k = encodedKeyIndex ^ c2;
    keys[i][4] = (byte)(k);
    keys[i][5] = (byte)(k >> 0x8);
    keys[i][6] = (byte)(k >> 0x10);
    keys[i][7] = (byte)(k >> 0x18);

    k = encodedKeyIndex ^ c3;
    keys[i][8] = (byte)(k);
    keys[i][9] = (byte)(k >> 0x8);
    keys[i][10] = (byte)(k >> 0x10);
    keys[i][11] = (byte)(k >> 0x18);

    k = encodedKeyIndex ^ c4;
    keys[i][12] = (byte)(k);
    keys[i][13] = (byte)(k >> 0x8);
    keys[i][14] = (byte)(k >> 0x10);
    keys[i][15] = (byte)(k >> 0x18);
  }
}

static void GenerateKeyLength(int keyLength[], uint32 keySalt, int length)
{
  int averageLength = length >> 5;
  int expectedLength = averageLength;

  for (int i = 0; i < 31; ++i)
  {
    uint32 a = INTEGER_CONSTANTS[(keySalt + i) & 0xFFF ^ 0x5d7];
    float b = FLOAT_CONSTANTS[a & 0xFFF ^ 0x885] - 0.5F;
    float c = (int)(b * averageLength) + expectedLength + 0xF & 0xFFFFFFF0; // 0x5D7 = 0xA37A55D7 & 0xFFF, 0x885 = (0xA37A55D7 ^ 0x67308D52) & 0xFFF
    keyLength[i] = (int)c;
    expectedLength += averageLength;
  }

  keyLength[31] = length;
}

static void GenerateSalt(byte salt[], uint32 keySalt)
{
  uint32 c = keySalt ^ 0x4bf0cf23;
  uint32 saltInt = 0;
  uint32 offset = 0x5d7;
  uint32 offsetChange = (keySalt >> 0x18) + (keySalt >> 0x10 & 0xFF) + (keySalt >> 0x8 & 0xFF) + (keySalt & 0xFF) + 1;
  for (int i = 0; i < 0x200; i += 4)
  {
    saltInt = INTEGER_CONSTANTS[offset & 0xFFF] ^ c;
    if ((saltInt & 0x7) == 1)
      saltInt ^= 0xbd75f29; // = crc32(0x1079000F, "MONSTER HUNTER WORLD: ICEBORNE".getBytes(StandardCharsets.UTF_8), 0, 0x1D)

    salt[i] = (byte)saltInt;
    salt[i + 1] = (byte)(saltInt >> 0x8);
    salt[i + 2] = (byte)(saltInt >> 0x10);
    salt[i + 3] = (byte)(saltInt >> 0x18);

    offset += offsetChange;
  }
}

static bool CheckHash(u8* save, u8* hash)
{
  return memcmp(save + 12, hash, 20);
}

static void SetHash(u8* save, u8* hash)
{
  memcpy(save + 12, hash, 20);
}

static bool DecryptRegion(u8* save, int offset, int length, int saveSlot)
{
  CryptoPP::ECB_Mode<CryptoPP::AES>::Decryption decryptor;

  byte salt[0x200] = {};
  byte keys[0x20][0x10] = {};
  int keyLength[0x20] = {};
  uint32 keySalt = Crc32(0xA37A55D7, save, offset + length, 0x200);
  int saveOffset = offset;

  GenerateSalt(salt, keySalt);
  GenerateKeys(keys, keySalt, salt);
  GenerateKeyLength(keyLength, keySalt, length);

  for (int i = 0; i < 32; ++i)
  {
    int saltOffset = 0;
    decryptor.SetKey(keys[i], 0x10);

    while (saveOffset < keyLength[i] + offset)
    {
      // if current salt is even, then salt 1st and 3rd word, decrypt, then salt 2nd and 4th word, otherwise do opposite
      int branch = (salt[saltOffset & 0x1FF] & 1) == 0 ? 4 : 0;
      save[saveOffset - branch + 4] ^= salt[saltOffset + 8 & 0x1FF];
      save[saveOffset - branch + 5] ^= salt[saltOffset + 9 & 0x1FF];
      save[saveOffset - branch + 6] ^= salt[saltOffset + 10 & 0x1FF];
      save[saveOffset - branch + 7] ^= salt[saltOffset + 11 & 0x1FF];

      save[saveOffset - branch + 12] ^= salt[saltOffset + 12 & 0x1FF];
      save[saveOffset - branch + 13] ^= salt[saltOffset + 13 & 0x1FF];
      save[saveOffset - branch + 14] ^= salt[saltOffset + 14 & 0x1FF];
      save[saveOffset - branch + 15] ^= salt[saltOffset + 15 & 0x1FF];

      decryptor.ProcessData(save + saveOffset, save + saveOffset, 0x10);

      save[saveOffset + branch + 0] ^= salt[saltOffset + 0 & 0x1FF];
      save[saveOffset + branch + 1] ^= salt[saltOffset + 1 & 0x1FF];
      save[saveOffset + branch + 2] ^= salt[saltOffset + 2 & 0x1FF];
      save[saveOffset + branch + 3] ^= salt[saltOffset + 3 & 0x1FF];

      save[saveOffset + branch + 8] ^= salt[saltOffset + 4 & 0x1FF];
      save[saveOffset + branch + 9] ^= salt[saltOffset + 5 & 0x1FF];
      save[saveOffset + branch + 10] ^= salt[saltOffset + 6 & 0x1FF];
      save[saveOffset + branch + 11] ^= salt[saltOffset + 7 & 0x1FF];

      saltOffset += 4;
      saveOffset += 16;
    }
  }

  u8* checksum = GenerateSlotChecksum(save, offset, length, saveSlot);
  bool match = CheckChecksum(save, checksum, offset, length);
  free(checksum);
  return match;
}

static u8* DecryptSave(u8* save, int length)
{
  blowfish_decrypt(save, length, KEY_SAVEDATA1000);

  u8* checksum = GenerateHash(save, length, 64);
  byteswap(checksum, 20);
  if (!CheckHash(save, checksum))
  {
    free(checksum);
    return nullptr;
  }
  free(checksum);

  DecryptRegion(save, 0x70, 0xDA50, 3);
  DecryptRegion(save, 0x3010D8, 0x2098C0, 0);
  DecryptRegion(save, 0x50AB98, 0x2098C0, 1);
  DecryptRegion(save, 0x714658, 0x2098C0, 2);

  return save;
}

static void EncryptRegion(byte* save, int offset, int length, int saveSlot)
{
  CryptoPP::ECB_Mode<CryptoPP::AES>::Encryption encryptor;

  byte salt[0x200] = {};
  byte keys[0x20][0x10] = {};
  int keyLength[0x20] = {};
  byte* checksum = GenerateSlotChecksum(save, offset, length, saveSlot);
  SetChecksum(save, checksum, offset, length);
  uint32 keySalt = Crc32(0xA37A55D7, checksum, 0, 0x200);
  int saveOffset = offset;
  free(checksum);

  GenerateSalt(salt, keySalt);
  GenerateKeys(keys, keySalt, salt);
  GenerateKeyLength(keyLength, keySalt, length);

  for (int i = 0; i < 32; ++i)
  {
    int saltOffset = 0;
    encryptor.SetKey(keys[i], 0x10);

    while (saveOffset < keyLength[i] + offset)
    {
      // if current salt is even, then salt 2nd and 4th word, encrypt, then salt 1st and 3rd word, otherwise do opposite
      int branch = (salt[saltOffset & 0x1FF] & 1) == 0 ? 4 : 0;
      save[saveOffset + branch + 0] ^= salt[saltOffset + 0 & 0x1FF];
      save[saveOffset + branch + 1] ^= salt[saltOffset + 1 & 0x1FF];
      save[saveOffset + branch + 2] ^= salt[saltOffset + 2 & 0x1FF];
      save[saveOffset + branch + 3] ^= salt[saltOffset + 3 & 0x1FF];

      save[saveOffset + branch + 8] ^= salt[saltOffset + 4 & 0x1FF];
      save[saveOffset + branch + 9] ^= salt[saltOffset + 5 & 0x1FF];
      save[saveOffset + branch + 10] ^= salt[saltOffset + 6 & 0x1FF];
      save[saveOffset + branch + 11] ^= salt[saltOffset + 7 & 0x1FF];

      encryptor.ProcessData(save + saveOffset, save + saveOffset, 0x10);

      save[saveOffset - branch + 4] ^= salt[saltOffset + 8 & 0x1FF];
      save[saveOffset - branch + 5] ^= salt[saltOffset + 9 & 0x1FF];
      save[saveOffset - branch + 6] ^= salt[saltOffset + 10 & 0x1FF];
      save[saveOffset - branch + 7] ^= salt[saltOffset + 11 & 0x1FF];

      save[saveOffset - branch + 12] ^= salt[saltOffset + 12 & 0x1FF];
      save[saveOffset - branch + 13] ^= salt[saltOffset + 13 & 0x1FF];
      save[saveOffset - branch + 14] ^= salt[saltOffset + 14 & 0x1FF];
      save[saveOffset - branch + 15] ^= salt[saltOffset + 15 & 0x1FF];
      saltOffset += 4;
      saveOffset += 16;
    }
  }
}

static u8* EncryptSave(u8* save, int length)
{
  EncryptRegion(save, 0x70, 0xDA50, 3);
  EncryptRegion(save, 0x3010D8, 0x2098C0, 0);
  EncryptRegion(save, 0x50AB98, 0x2098C0, 1);
  EncryptRegion(save, 0x714658, 0x2098C0, 2);

  u8* checksum = GenerateHash(save, length, 64);
  SetHash(save, checksum);
  free(checksum);

  blowfish_encrypt(save, length, KEY_SAVEDATA1000);
  return save;
}
